import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <h1>Medi Connect</h1>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/about">About</Link></li>
        <li><a href="https://esanjeevani.mohfw.gov.in/#/">Sanjeevani App</a></li>
        <li><Link to="/otp-auth">Chat</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
